import './App.css';
import Sea from './Searchbar.js'

function App() {
  return (
    <div>
      <h1>Welcome to Easy Tracking!</h1>
      <p>Login Page</p>
      <Auth />
      <SearchBar />

    </div>
  );
}

function Auth() {
  return (
    <form action="/submit" method="post">
      <div>
        <label>Email: </label>
        <input type="email" placeholder='Please enter your Email' style={{ width: '200px', marginLeft: '23px' }} required title="Please enter a valid email address." />
      </div>
      <div>
        <label>Password: </label>
        <input type="password" placeholder='Please enter your Password' style={{ marginRight: '10px', width: '200px' }} required pattern="(?=.*[a-z])(?=.*[A-Z])(?=.*\d).{8,}"
          title="Password must contain at least 8 characters, including at least one lowercase letter, one uppercase letter, and one digit." />
      </div>
      <button type="submit">Submit</button>
    </form>
  )
}


export default App;
